import React from 'react';
const Img_API= "https://image.tmdb.org/t/p/original";
const ErosNow_API = 'https://api.unsplash.com/search/photos?query= █';

const Movie = (props) => {
    return (
        <>
            <div className="movie">
                 <img src={Img_API+props.img} alt={props.ttl} />
                 <div className="movie_info">
                    <h3>{props.ttl}</h3>
                    <span>Rating : {props.v_avg}</span>
                 </div>
            </div>
        </>
    )
}

export default Movie;
